import React from 'react';
import { Container, GridRow, Header } from 'semantic-ui-react';


export default ({ controles }) => (
    <Container>
        <Grid>
            {controles.map(controle => (<GridRow key={controle.CONROLE_IDENT}>
                <Header>{controle.ACDG_CODE_ACTION} {controle.ACDG_LIBELLE}</Header>
            </GridRow>))}
        </Grid>
    </Container>
)
